(4734, 331, 'primary', 4, 'text', 'description', 'Can you tell us what happened?', '0', 'Late evening (around 7.30 pm) after shopping, I was trying to look for an auto to go back home. As the traffic was at its peak, I could not get any so I started walking towards the flyover in the hope that I would get one at the T point. This patch is a little deserted but has a lot of traffic. Mysteriously a lot of passing vehicles started to slow down near me as if asking for directions. After 2 vehicles I realized that most of these vehicles were single men driving big cars. These well educated men in big cars, on seeing a woman walking on the road alone at 7.30 could only think of two things - \"She is a hooker\"...or she is alone therefore \"available\". Felt sick and so vulnerable!', '', '{\"option_id\":0,\"answer\":\"Late evening (around 7.30 pm) after shopping, I was trying to look for an auto to go back home. As the traffic was at its peak, I could not get any so I started walking towards the flyover in the hope that I would get one at the T point. This patch is a little deserted but has a lot of traffic. Mysteriously a lot of passing vehicles started to slow down near me as if asking for directions. After 2 vehicles I realized that most of these vehicles were single men driving big cars. These well educated men in big cars, on seeing a woman walking on the road alone at 7.30 could only think of two things - \\\"She is a hooker\\\"...or she is alone therefore \\\"available\\\". Felt sick and so vulnerable!\",\"form_type\":\"primary\"}'),
