(4783, 334, 'primary', 4, 'text', 'description', 'Can you tell us what happened?', '0', 'I was walking back home from my institute when a guy tapped my shoulder from back and asked me the way of a street nearby. I politely gave the answer but he asked again - nahi nahi , main usss wali gali ki baat kr ra hoon. I dint understand.he started laughing looking at me n then i commemorated, there were 4 rapes reported on that street. i was horrified. He laughed loud and mockingly zipped-unzipped his pant. I ran back to home. But no doubt , m scared to go out even in the shops nearby. Moreover, i get these frequent calls from unknown guys who keep on calling. I have to keep my cell in flight mode the whole day. :(', '', '{\"option_id\":0,\"answer\":\"I was walking back home from my institute when a guy tapped my shoulder from back and asked me the way of a street nearby. I politely gave the answer but he asked again - nahi nahi , main usss wali gali ki baat kr ra hoon. I dint understand.he started laughing looking at me n then i commemorated, there were 4 rapes reported on that street. i was horrified. He laughed loud and mockingly zipped-unzipped his pant. I ran back to home. But no doubt , m scared to go out even in the shops nearby. Moreover, i get these frequent calls from unknown guys who keep on calling. I have to keep my cell in flight mode the whole day. :(\",\"form_type\":\"primary\"}'),
