(5432, 381, 'primary', 4, 'text', 'description', 'Can you tell us what happened?', '0', 'One of our neighbor, a female in her late 20s was returning from office at around 9:30PM on 14th January 2013 on the shown street which connects the main road to our apartments.   She was attacked by an yet-unidentified person, trying to snatch her purse and mobile. On resisting his attempt, he assaulted the female by throwing her on the ground and trying to pull her sweater.  She screamed and some of us who were nearby, including me, rushed to help. But the empty ground on the side was too dark, and the miscreant ran away.  We informed the police about the incident immediately.', '', '{\"option_id\":0,\"answer\":\"One of our neighbor, a female in her late 20s was returning from office at around 9:30PM on 14th January 2013 on the shown street which connects the main road to our apartments.   She was attacked by an yet-unidentified person, trying to snatch her purse and mobile. On resisting his attempt, he assaulted the female by throwing her on the ground and trying to pull her sweater.  She screamed and some of us who were nearby, including me, rushed to help. But the empty ground on the side was too dark, and the miscreant ran away.  We informed the police about the incident immediately.\",\"form_type\":\"primary\"}'),
