(5952, 422, 'primary', 4, 'text', 'description', 'Can you tell us what happened?', '0', 'I was returning home from a night out with some friends. I had had exactly half a bottle of beer (pls note that this does not even fall under the category of \'alcohol drinking\') since I was driving. At a police checkpoint, I was confident but respectfully asked if they could have a lady officer checking my alcohol content on the breathalyser due to a prior shocking incident where the police pulled out my keys and made me blow into the breathalyser 4 times since they couldn\'t find alcohol on my breath. Of course, this time round I was smarter and more cautious and did not fall victim much prior to them repeating the horror...or so I thought! The inspector said that \'they will not touch me and feel me\' so I should cooperate with them testing my breath. However, I found that disrespectful and did not lower the window. They then clamped my car and began to shoot a video. I waited for somebody I know to come and when that happened, used the breathalyser. Of course, the alcohol content was negative and they made me blow a second time. By this time, we argued to be let go and left the place. How are we to feel safe when the police themselves do not strive to instill that confidence in women? After all this, they say that women should not even be out on the streets after sundown! Absolutely ridiculous. Lets work towards a safer future. Together.', '', '{\"option_id\":0,\"answer\":\"I was returning home from a night out with some friends. I had had exactly half a bottle of beer (pls note that this does not even fall under the category of \'alcohol drinking\') since I was driving. At a police checkpoint, I was confident but respectfully asked if they could have a lady officer checking my alcohol content on the breathalyser due to a prior shocking incident where the police pulled out my keys and made me blow into the breathalyser 4 times since they couldn\'t find alcohol on my breath. Of course, this time round I was smarter and more cautious and did not fall victim much prior to them repeating the horror...or so I thought! The inspector said that \'they will not touch me and feel me\' so I should cooperate with them testing my breath. However, I found that disrespectful and did not lower the window. They then clamped my car and began to shoot a video. I waited for somebody I know to come and when that happened, used the breathalyser. Of course, the alcohol content was negative and they made me blow a second time. By this time, we argued to be let go and left the place. How are we to feel safe when the police themselves do not strive to instill that confidence in women? After all this, they say that women should not even be out on the streets after sundown! Absolutely ridiculous. Lets work towards a safer future. Together.\",\"form_type\":\"primary\"}'),
