pleaded to be left as her children were at home.They did not heed to her request. After 10 PM she told them that as she is HIV infected it is very important for her to take medicines on time. Hearing that police men went mad with rage. They accused her she does not deserve to be alive, she has polluted the whole place and they held her in police custody till 1 AM.She was so traumatised as she could not call anybody as everything was stored in her mobile.When I told her that we shall lodge complaint she is very scared.  She reported to me and said one line which was very touching Madam, as women don\\\\\'t I have even liberty to see temple festival\",\"form_type\":\"primary\"}'),
