(6441, 458, 'primary', 4, 'text', 'description', 'Can you tell us what happened?', '0', 'I was walking 200 mts from where I stay, at 9 pm, in 22 Eastgate St, Gloucester GL1 1PA, United Kingdom and a man on a bike wearing a helmet hit me on my behind (spanked me) and then groped me in the chest and sped off. since it was raining that day , i could not catch his bike number properly or the make. similarly there are always guys around who are doing stuff like this in this area since my room-mate faced a similar problem at 8 pm. There are men who pass snide and cheap comments when u walk these streets even at 6 pm when u visit the mall. my friend told a police van doing rounds one day , but the security is still very lax. something should be done. we feel unsafe to step out after dark. and who knows if it happens during the day ? now its just groping, some day it might get worse.', '', '{\"option_id\":0,\"answer\":\"I was walking 200 mts from where I stay, at 9 pm, in 22 Eastgate St, Gloucester GL1 1PA, United Kingdom and a man on a bike wearing a helmet hit me on my behind (spanked me) and then groped me in the chest and sped off. since it was raining that day , i could not catch his bike number properly or the make. similarly there are always guys around who are doing stuff like this in this area since my room-mate faced a similar problem at 8 pm. There are men who pass snide and cheap comments when u walk these streets even at 6 pm when u visit the mall. my friend told a police van doing rounds one day , but the security is still very lax. something should be done. we feel unsafe to step out after dark. and who knows if it happens during the day ? now its just groping, some day it might get worse.\",\"form_type\":\"primary\"}'),
