INSERT INTO `question_translation` (`question_id`, `lang_id`, `question`, `subtext`, `properties`, `is_default`) VALUES
(1, 1, 'Who are you sharing for?', 'In case you are reporting for someone else, please\r\nmake sure you answer the questions on their behalf', '{\"type\":\"radio\"}', 1),
(2, 1, 'How old are you?', 'This information will help us understand the incident better.', '{ \"type\":\"text\", \"placeholder\": \"Please enter a number for you age in years. Example 40.\", \"validations\": [ { \"required\": true, \"message\": \"Age is required\" }, { \"type\": \"number\", \"message\": \"Please enter a valid number\" }, { \"min\": 18, \"message\": \"Age cannot be below 18\" }, { \"max\": 120, \"message\": \"Age cannot be greater than 120\" } ] }', 1),
(3, 1, 'Please tell us your gender', 'This information will help us understand the incident better.', '{\"type\":\"radio\"}', 1),
(4, 1, 'Can you tell us what happened?', 'We know this is hard to revisit. But this information will help us understand the incident better.', '{\r\n	\"type\":\"text\", \r\n	\"placeholder\": \"Please type your experience here\",\r\n	\"validations\": \r\n		[\r\n			{\r\n				\"required\": true,\r\n				\"message\": \"This field is required\"\r\n			},\r\n			{\r\n				\"pattern\": true,\r\n				\"message\": \"Only Alphabets Numbers and Space are allowed\"\r\n			}\r\n		]\r\n}', 1),
(5, 1, 'Can you tell us when this happened?', '', '{\"type\":\"estimate-datepicker\"}', 1),
(6, 1, 'Can you tell us when this happened?', '', '\r\n{\r\n	\"type\":\"estimate-time-or-rangepicker\",\r\n	\"validations\":\r\n		[\r\n			{\r\n				\"timeorrange\": \"Please select Time OR Time Range.\",\r\n				\"maintime\": \"Please select time to proceed.\",\r\n				\"startendtime\": \"Please select Start Time and End Time to proceed.\",\r\n				\"timediff\": \"End Time should be Greater Than Start Time.\"\r\n			}\r\n		]\r\n}', 1),
(7, 1, 'What type of sexual violence did you experience?', 'This information will help us understand the incident better.', '{\"type\":\"checkbox\"}', 1),
(8, 1, 'Did you seek/receive medical attention?', '', '{\"type\":\"radio\"}', 1),
(9, 1, 'Were you physically hurt?', '', '{\"type\":\"radio\"}', 1),
(10, 1, 'Who was the perpetrator?', '', '{\"type\":\"radio\"}', 1),
(11, 1, 'Have you reported the incident to the police?', '', '{\"type\":\"radio\"}', 1),
(12, 1, 'Do you feel any of the below led to you being attacked?', '(Select all that Apply)', '{\"type\":\"checkbox\"}', 1),
(13, 1, 'Would you like to add anything else about your experience?', '', '{\r\n	\"type\":\"text\",\r\n	\"placeholder\": \"Please type here.\",\r\n	\"validations\": \r\n		[\r\n			{\r\n				\"required\": true,\r\n				\"message\": \"This field is required\"\r\n			},\r\n			{\r\n				\"pattern\": true,\r\n				\"message\": \"Only Alphabets Numbers and Space are allowed\"\r\n			}\r\n		]\r\n}', 1),
(14, 1, 'You\'re doing great. Just one more step to go!<br>Please tell us where the incident took place<span class=\'error\'>*</span>', '', '{\r\n	\"type\":\"incident-address-form\",\r\n	\"validations\": \r\n		[\r\n			{\r\n				\"required\": true,\r\n				\"message\": \"This field is required\"\r\n			}\r\n		]\r\n}', 1),
(15, 1, 'You\'re doing great. Just one more step to go!', 'Please move the pin to the exact location:\r\n', '{\"type\":\"incident-pin-map\"}', 1),
